import { AUTH } from "../constants/actionTypes";
import * as api from "../api";

const signUp = (formData, history) => async (dispatch) => {
  try {
    //log in the user
    history("/");
  } catch (error) {
    console.log(error);
  }
};
const signIn = () => async (dispatch) => {
  try {
    //log in the user
    history("/");
  } catch (error) {
    console.log(error);
  }
};
